--
-- Table structure
--
CREATE TABLE performers (
  ID bigint CHECK (ID > 0) NOT NULL,
  act_name varchar(100) NOT NULL DEFAULT '',
  url varchar(50) NOT NULL DEFAULT '',
  thumbnail text,
  city_name varchar(90) NOT NULL DEFAULT '',
  state_code char(2) NOT NULL DEFAULT '',
  state_name varchar(90) NOT NULL DEFAULT '',
  country_code char(2) NOT NULL DEFAULT '',
  category_name varchar(100) NOT NULL DEFAULT ''
) ;

 GRANT ALL PRIVILEGES ON TABLE performers to gigsalad;

--
-- Table indexes
--
ALTER TABLE performers ADD PRIMARY KEY (ID);

